import "@material-ui/core";
import {
  List,
  ListItem,
  ListItemText,
  Card,
  CardContent,
  Typography,
} from "@material-ui/core";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams,
} from "react-router-dom";

import "./App.css";
import logo from "./logo.png";
import Twitts from "./Twitts";
import Charts from "./Charts";

function App() {
  /**
   * <List>
            {["HOME", "CDU", "SPD", "AFD", "FDP", "LINKE", "GRÜN"].map(
