              )
            )}
          </List>

          <div className="app_right">
        <Twitts />
        <Charts />
      </div>
   */
  return (
    <div className="app">
      <div className="landing_page">landing page</div>

      <Router>
        <div className="app_left">
          <img src={logo} style={{ display: "flex", width: "100%" }}></img>

          <Link to="/">
            <ListItem button>home</ListItem>
          </Link>

          <Link to="/CDU">CDU</Link>

          <Link to="/SPD">SPD</Link>

          <Link to="/FDP">FDP</Link>

          <Link to="/AFD">AFD</Link>

          <Link to="/LINKE">LINKE</Link>

          <Link to="/GRÜN">GRÜN</Link>
        </div>

        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/CDU">
            <CDU />
          </Route>
          <Route path="/SPD">
            <SPD />
          </Route>
          <Route path="/AFD">
            <AFD />
          </Route>
          <Route path="/FDP">
            <FDP />
          </Route>
          <Route path="/LINKE">
            <LINKE />
          </Route>
          <Route path="/GRÜN">
            <GRÜN />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}
function Home() {
  return (
    <div className="app_right">
      <Charts />
    </div>
  );
}
function CDU() {
